import React from "react";
import { FiSearch } from "react-icons/fi";
const Header = () => {
  return (
    <div className=" w-full  text-white fixed z-10 bg-gray-700 py-5">
      <div className="flex items-center pl-3">
        <div className="font-bold  w-20 ">MyPass</div>
        <input
          type="text"
          name="aradio"
          value="A"
          checked="checked"
          className=" rounded-lg py-1 text-center text-slate-500   resize-none h-8"
        >
          Search
        </input>
      </div>
    </div>
  );
};

export default Header;
